@gunan The Jenkins build error seems to be that clang is not happy with `-Wno-maybe-uninitialized`. 

I have changed the `-Wno-maybe-uninitialized`to `-Wno-uninitialized`. I think that should address the clang error.

(My dev machine is Ubuntu 16.04 + GCC so didn't notice that before).
